  id: Quinc
  version: -1
name: Quinc
display: Quinc
category: Forensics & Malware Analysis
image: data:image/png;base64,
configuration:
- display: ""
  name: ServerName
  defaultvalue: ""
  type: 0
  required: true
- display: ""
  name: token
  defaultvalue: ""
  type: 0
  required: true
- display: ""
  name: scheme
  defaultvalue: http
  type: 15
  required: true
  options:
  - http
  - https
script:
  script: |-
    import sys, os, requests, datetime, json
    from requests.exceptions import HTTPError

    # disable insecure warnings
    requests.packages.urllib3.disable_warnings()

    AUTH_HEADERS = { 'EnterpriseApiKey' : demisto.params()['token'], 'Accept': 'application/json', 'Content-Type':  'application/json'}
    USE_SSL = not demisto.params().get('insecure', True)
    QUINC_URL = demisto.params().get('scheme', 'http') + '://' + demisto.params().get('ServerName') + ':4443/'
    JOBID_KEY = 'Accessdata.Job.ID'
    JOBRESULT_KEY = 'Accessdata.Job.Result'
    JOBSTATE_KEY = 'Accessdata.Job.State'
    JOB_KEY = 'Accessdata.Job'

    # Sends request to the server using the given method, url, headers and params
    def send_request(method, url, body=None, headers=AUTH_HEADERS, params=None):
        try:
            res = requests.request(method, url, data=body, headers=headers, params=params, verify=USE_SSL)
            res.raise_for_status()
        except HTTPError, e:
            err_json = res.json()
            err_msg = ''
            if 'message' in err_json:
              err_msg = err_msg + 'Error: {0}.\n'.format(err_json['message'])
            elif 'http_response' in err_json:
              err_msg = err_msg + 'Error: {0}.\n'.format(err_json['http_response'])
            if 'code' in err_json:
              err_msg = err_msg + 'QRadar Error Code: {0}'.format(err_json['code'])
            return_error(err_msg)
        return res.json()

    def SendQuincTestRequest():
        url = 'api/v2/enterpriseapi/statuscheck';
        res = send_request('GET', QUINC_URL + url)
        return res.lower()

    def QuincLegacyAgentSoftwareInventory(arg):
        url = 'api/v2/enterpriseapi/agent/'+ arg['caseid'] +'/sofwareinventory';
        data = {
            'ips': { 'targets' : [arg['targetIP']]},
            'SoftwareInvJob': {'Operation': 24 }
        }
        res = send_request('POST', QUINC_URL + url, json.dumps(data))
        executeCommand('delContext', { key: JOBID_KEY });
        return {
            'Type': entryTypes['note'],
            'Contents': res,
            'ContentsFormat': formats['text'],
            'HumanReadable': 'JobID: ' + str(res),
            'EntryContext': {JOBID_KEY : res}
        }

    def create_jobstate_context(contents):
        return {
             JOB_KEY+'(val.ID == obj.ID)' : contents
        }

    def create_contents(id, state, result):
        ec = {
            'ID' : id,
            'State': state,
            'Result' : result
        }
        return ec

    def quinc_get_jobstatus_command(args):
        url = 'api/v2/enterpriseapi/core/' + str(args['caseID']) + '/getjobstatus/' + str(args['jobID'])
        res = send_request('GET', QUINC_URL + url)

        if 'resultData' not in res:
            contents = create_contents(args['jobID'], 'Failed', res)
            return {
                'Type' : entryTypes['note'],
                'ContentsFormat' : formats['json'],
                'Contents': contents,
                'HumanReadable': "No data in job result",
                'EntryContext': create_jobstate_context(contents)
            }
        resultData = json.loads(res['resultData'])
        if 'RealData' not in resultData:
            contents = create_contents(args['jobID'], 'Failed', resultData)
            return {
                'Type' : entryTypes['note'],
                'ContentsFormat' : formats['json'],
                'Contents': contents,
                'HumanReadable': "No data in job result",
                'EntryContext': create_jobstate_context(contents)
            }
        RealData = json.loads(resultData['RealData'])
        if 'TaskStatusList' not in RealData:
            contents = create_contents(args['jobID'], 'Failed', RealData)
            return {
                'Type' : entryTypes['note'],
                'ContentsFormat' : formats['json'],
                'Contents': contents,
                'HumanReadable': "No task data in job result",
                'EntryContext': create_jobstate_context(contents)
            }

        task = RealData['TaskStatusList'][0];
        if task is not None:
            if task['State'] is None:
                contents = create_contents(args['jobID'], 'Unknown', task)
                return {
                    'Type' : entryTypes['note'],
                    'ContentsFormat' : formats['json'],
                    'Contents': contents,
                    'HumanReadable': "Cannot get job state",
                    'EntryContext' : create_jobstate_context(contents)
                }
            if task['State'] != 'Success':
                contents = create_contents(args['jobID'], task['State'], task)
                return {
                    'Type' : entryTypes['note'],
                    'ContentsFormat' : formats['json'],
                    'Contents': contents,
                    'HumanReadable': "Current job state: " + task['State'],
                    'EntryContext': create_jobstate_context(contents)
                }
            else:
                result = json.loads(task['Results'][0]['Data'])
                res = json.loads(task['Results'][1]['Data'])
                if result['OperationType'] == 24: #software inventory
                    contents = create_contents(args['jobID'], 'Success', res['Applications'])
                    return {
                        'Type': entryTypes['note'],
                        'Contents': contents,
                        'ContentsFormat': formats['json'],
                        'HumanReadable': tableToMarkdown('Applications', res['Applications'], ['Name', 'Version', 'Publisher',
                        'InstallDate', 'InstallLocation', 'InstallSource', 'EstimatedSizeInBytes']),
                        'EntryContext': create_jobstate_context(contents)
                    }
                elif result['OperationType'] == 12: #volatile data
                    contents = create_contents(args['jobID'], 'Success', res)
                    return {
                        'Type': entryTypes['note'],
                        'Contents': contents,
                        'ContentsFormat': formats['json'],
                        'HumanReadable': "Job completed successfully",
                        'EntryContext': create_jobstate_context(contents)
                    }
                else:
                    contents = create_contents(args['jobID'], 'Success', task)
                    return {
                        'Type' : entryTypes['note'],
                        'ContentsFormat' : formats['json'],
                        'Contents': contents,
                        'HumanReadable': "Job completed successfully",
                        'EntryContext': create_jobstate_context(contents)
                    }
        contents = create_contents(args['jobID'], 'Unknown', None)
        return {
            'Type' : entryTypes['note'],
            'ContentsFormat' : formats['json'],
            'Contents': contents,
            'HumanReadable': "Job exited unexpectedly",
            'EntryContext' : create_jobstate_context(contents)
        }

    def quinc_legacyagent_runvolatilejob_command(args):
        url = 'api/v2/enterpriseapi/agent/' + args['caseid'] + '/volatile';
        data = {
            'ips': { 'targets' : [args['targetIP']]},
            'Volatile' : {
                'Operation': 12,
                'IncludeProcessTree' : True,
                'ProcessTreeOptions' : {
                    'DetectHiddenProcesses' : True,
                    'IncludeDlls' : True,
                    'IncludeSockets' : True
                }
            }
        }
        res = send_request('POST',  QUINC_URL + url, json.dumps(data))
        ec = {
            'ID': res,
            'Type': 'Volatile'
        }

        return {
            'Type' : entryTypes['note'],
            'ContentsFormat' : formats['text'],
            'Contents' : res,
            'HumanReadable': "JobID: " + str(res),
            'EntryContext': { JOB_KEY+'(val.ID && val.Type == obj.Type)' : ec }
        }

    def quinc_legacyagent_runmemoryacquisition_command(args):
        url = 'api/v2/enterpriseapi/agent/' + args['caseid'] + '/memoryacquistion';
        data = {
            'ips': { 'targets' : [args['targetIP']]},
            'MemoryAcquistion' : { 'Operation': 11 }
        }
        res = send_request('POST',  QUINC_URL + url, json.dumps(data))
        ec = {
            'ID': res,
            'Type': 'LegacyMemoryDump'
        }
        return {
            'Type' : entryTypes['note'],
            'ContentsFormat' : formats['json'],
            'Contents' : ec,
            'HumanReadable': "JobID: " + str(res),
            'EntryContext': { JOB_KEY+'(val.ID && val.Type == obj.Type)' : ec }
        }

    def quinc_read_casefile_command(args):
        url = 'api/v2/enterpriseapi/core/readfilecontents';
        data = args['filepath']
        res = send_request('POST',  QUINC_URL + url, json.dumps(data))
        return {
            'Type' : entryTypes['note'],
            'ContentsFormat' : formats['text'],
            'Contents' : res,
            'EntryContext': { 'Accessdata.File.Contents' : res }
        }

    # The command demisto.command() holds the command sent from the user.
    if demisto.command() == 'test-module':
        # This is the call made when pressing the integration test button.
        demisto.results(SendQuincTestRequest())
        sys.exit(0)
    if demisto.command() == 'accessdata-legacyagent-get-software':
        demisto.results(QuincLegacyAgentSoftwareInventory(demisto.args()))
        sys.exit(0)
    if demisto.command() == 'accessdata-get-jobstatus':
        demisto.results(quinc_get_jobstatus_command(demisto.args()))
        sys.exit(0)
    if demisto.command() == 'accessdata-legacyagent-get-processlist':
        demisto.results(quinc_legacyagent_runvolatilejob_command(demisto.args()))
        sys.exit(0)
    if demisto.command() == 'accessdata-legacyagent-get-memorydump':
        demisto.results(quinc_legacyagent_runmemoryacquisition_command(demisto.args()))
        sys.exit(0)
    if demisto.command() == 'accessdata-read-casefile':
        demisto.results(quinc_read_casefile_command(demisto.args()))
        sys.exit(0)

    if demisto.command() == 'fetch-incidents':
        # You can store the last run time...
        demisto.setLastRun({'time': 'now'})
        # And retrieve it for use later:
        lastRun = demisto.getLastRun()
        # lastRun is a dictionary, with value "now" for key "time".
        # JSON of the incident type created by this integration
        demisto.incidents([{"Name":"Incident #1"},{"Name":"Incident #2"}])
        sys.exit(0)
    # You can use demisto.args()[argName] to get a specific arg. args are strings.
    # You can use demisto.params()[paramName] to get a specific params.
    # Params are of the type given in the integration page creation.
  type: python
  commands:
  - name: accessdata-legacyagent-get-software
    arguments:
    - name: caseid
      required: true
      description: ID of case
    - name: targetIP
      required: true
      description: IP address of agent
    outputs:
    - contextPath: JobID
      description: ID of job
      type: number
    description: Get installed software from legacy agent
  - name: accessdata-get-jobstatus
    arguments:
    - name: caseID
      required: true
      description: ID of case
    - name: jobID
      required: true
      description: ID of job
    outputs:
    - contextPath: State
      description: Job state
      type: string
    - contextPath: Result
      description: Job result
    description: Get status of job
  - name: accessdata-legacyagent-get-processlist
    arguments:
    - name: caseid
      required: true
      description: ID of case
    - name: targetIP
      required: true
      description: IP address of agent
    outputs:
    - contextPath: Accessdata.Job(val.Type=="Volatile").ID
      description: ID of job
    description: Return list of process from legacy agent
  - name: accessdata-legacyagent-get-memorydump
    arguments:
    - name: caseid
      required: true
      description: ID of case
    - name: targetIP
      required: true
      description: IP address of agent
    outputs:
    - contextPath: Accessdata.Job.ID
      description: ID of job
    description: Creates legacy agent memory dump
  - name: accessdata-read-casefile
    arguments:
    - name: filepath
      required: true
    outputs:
    - contextPath: Accessdata.File.Contents
      description: Contents of the file
    description: Reads file from case folder and puts its contents to current context
  runonce: false
